b9e155ecbd143fab:
String used to localize dates in a basic format. Basic Latin letters are coded placeholders for date elements, that will be replaced by the localized value (do not translate these codes):
* <code>D</code>: localized name of a weekday;
* <code>j</code>: localized number of the day in the month (not padded with leading zeroes);
* <code>M</code>: localized name of the month;
* <code>Y</code>: Gregorian year (padded with leading zeroes if there's less than 4 digits);
* if you need to include litteral letters in the format string, place them between <code>"</code>ASCII double quotes<code>"</code>;
* other spaces or punctuation are used litterally in the formatted date and don't need to be enclosed in <code>"</code>ASCII double quotes<code>"</code>.

